import Vue from 'vue';
import Router from 'vue-router';
import Login from './views/Login.vue';
import Main from './views/Main.vue';
import NotFound from './views/NotFound.vue';
import Plist from './views/ProductList.vue';
import Padd from './views/ProductAdd.vue';
import Stat from './views/Stat.vue';
import Uadd from './views/UserAdd.vue';
import Ulist from './views/UserList.vue';
Vue.use(Router);
export default new Router({
  routes: [{
    path: '/',
    name: 'login',
    component: Login
  }, {
    path: '/login',
    name: 'login',
    component: Login
  }, {
    path: '/main',
    name: 'main',
    component: Main,
    children: [{
      path: '',
      name: 'stat',
      component: Stat
    }, {
      path: 'stat',
      name: 'stat',
      component: Stat
    }, {
      path: 'plist',
      name: 'plist',
      component: Plist
    }, {
      path: 'padd',
      name: 'padd',
      component: Padd
    }, {
      path: 'ulist',
      name: 'ulist',
      component: Ulist
    }, {
      path: 'uadd',
      name: 'uadd',
      component: Uadd
    }]
  }, {
    path: '/*',
    name: 'notfound',
    component: NotFound
  }]
});
